if(typeof checkLevelAll==="undefined"){function checkLevelAll(a){let obj_checkbox=document.getElementsByName("smsLevel[]");for(let i=0;i<obj_checkbox.length;i++){obj_checkbox[i].checked=a}}}if(typeof setSmsByte==="undefined"){function setSmsByte(b,a){a.innerText=getSmsByte(b)+" Byte"}}if(typeof getSmsByte==="undefined"){function getSmsByte(a){let length=0;let intTextLength=a.length;for(let i=0;i<intTextLength;i++){if(a.charCodeAt(i)>128){length+=2}else{length++}}return length}};